import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './components/Home';
import Shop from './components/Shop';
import Contact from './components/Contact';



function App() {
  const additionalData = 'Additional Data';
  return (

    <Router>
    <div>
      <Navbar title="MyFurniture" />

      <Route path="/" exact render={() => <Home additionalData={additionalData} />} />
      <Route path="/shop" render={() => <Shop additionalData={additionalData} />} />
      <Route path="/contact" render={() => <Contact additionalData={additionalData} />} />
    </div>
  </Router>
);
}









export default App;
